import React from 'react';

function Bienvenida({ username = "Nombre del Usuario" }) {
    return (
        <div style={{ padding: '20px' }}>
        {/* Barra superior */}
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
            <button style={{ background: '#a78Bfa', color: '#fff' }}>Soporte</button>
            <button style={{ background: '#7dd3fc', color: '#222' }}>Logo</button>
            <button style={{ background: '#a78Bfa', color: '#fff' }}>Exit</button>
        </div>
        {/* Menú lateral */}
        <div style={{ margin: '10px 0' }}>
            <button style={{ background: '#a78Bfa', color: '#fff' }}>≡</button>
        </div>
        {/* Mensaje */}
        <h2>Bienvenido "{username}"</h2>
        {/* Atajos central */}
        <div style={{
            margin: '20px auto', maxWidth: 400, background: '#f5f3ff', padding: 20, borderRadius: 10
        }}>
            <h3>Atajos</h3>
            <button style={{ width: '100%', margin: '10px 0', background: '#a78Bfa', color: '#222', padding: '10px', borderRadius: 8 }}>Hacer pedido</button>
            <button style={{ width: '100%', margin: '10px 0', background: '#a78Bfa', color: '#222', padding: '10px', borderRadius: 8 }}>Ver todos los pedidos</button>
            <button style={{ width: '100%', margin: '10px 0', background: '#a78Bfa', color: '#222', padding: '10px', borderRadius: 8 }}>Saldo Actual</button>
            <button style={{ width: '100%', margin: '10px 0', background: '#a78Bfa', color: '#222', padding: '10px', borderRadius: 8 }}>Predicciones (Beta)</button>
        </div>
        {/* Panel derecho */}
        <div style={{
            position: 'absolute',
            right: 20,
            top: 100
        }}>
            <div style={{ background: '#f472b6', padding: 8, borderRadius: 8, marginBottom: 6 }}>Información General</div>
            <div style={{ background: '#f472b6', padding: 8, borderRadius: 8, marginBottom: 6 }}>Último pedido</div>
            <div style={{ background: '#f472b6', padding: 8, borderRadius: 8, marginBottom: 6 }}>Pedidos Pendientes</div>
            <div style={{ background: '#f472b6', padding: 8, borderRadius: 8, marginBottom: 6 }}>Inventario</div>
            <div style={{ background: '#f472b6', padding: 8, borderRadius: 8 }}>Próximo Pedido</div>
        </div>
        </div>
    );
}

export default Bienvenida;
